INSERT INTO `uk_templet` VALUES ('4028811b6191e289016191edc7b50348', '雷达图', NULL, 'report', NULL, '2018-02-14 09:28:54', NULL, NULL, '	<script>\r\n	<#if reportData??>\r\n	var data_${element.mid!\'\'} = [];\r\n	var mea_${element.mid!\'\'} = [];\r\n		<#if reportData.row??>\r\n			<#list reportData.row.title as title>\r\n				<#if (title_index+1) == reportData.row.title?size>\r\n					<#if reportData.col??>\r\n						<#list reportData.col.title as coltlist>\r\n							<#list coltlist as coltl>\r\n									var obj_${element.mid!\'\'} = new Object();\r\n									obj_${element.mid!\'\'}[\"_name\"] = \"${coltl.rename!coltl.name!\'\'}\";\r\n									<#list title as rowtl2>							\r\n									<#if reportData?? && reportData.data??>\r\n										<#list reportData.data as values>\r\n											<#if rowtl2_index == values_index>\r\n												<#list values as val>	\r\n													<#if coltl_index == val_index>\r\n														obj_${element.mid!\'\'}[\"${rowtl2.rename!rowtl2.name!\'\'}\"] = ${val.valueStyle!val.foramatValue!\'\'}\r\n													</#if>\r\n												</#list>\r\n											</#if>\r\n										</#list>\r\n									</#if>\r\n									</#list>\r\n									data_${element.mid!\'\'}.push(obj_${element.mid!\'\'});						\r\n							</#list>\r\n						</#list>\r\n					</#if>\r\n					<#list title as rowtl>						\r\n						mea_${element.mid!\'\'}.push(\'${rowtl.rename!rowtl.name!\'\'}\');						\r\n					</#list>\r\n				</#if>\r\n			</#list>\r\n		</#if>\r\n	<#else>\r\n		const data_${element.mid!\'\'} = [\r\n			{ _name:\'London\', \'Jan.\': 18.9, \'Feb.\': 28.8, \'Mar.\' :39.3, \'Apr.\': 81.4, \'May\': 47, \'Jun.\': 20.3, \'Jul.\': 24, \'Aug.\': 35.6 },\r\n			{ _name:\'Berlin\', \'Jan.\': 12.4, \'Feb.\': 23.2, \'Mar.\' :34.5, \'Apr.\': 99.7, \'May\': 52.6, \'Jun.\': 35.5, \'Jul.\': 37.4, \'Aug.\': 42.4}\r\n		  ];\r\n		const mea_${element.mid!\'\'} =  [ \'Jan.\',\'Feb.\',\'Mar.\',\'Apr.\',\'May\',\'Jun.\',\'Jul.\',\'Aug.\' ];\r\n	</#if>\r\n	const ds_${element.mid!\'\'} = new DataSet();\r\n	const dv_${element.mid!\'\'} = ds_${element.mid!\'\'}.createView().source(data_${element.mid!\'\'});\r\n	  dv_${element.mid!\'\'}.transform({\r\n		type: \'fold\',\r\n		fields: mea_${element.mid!\'\'}, // 展开字段集\r\n		key: \'key\', // key字段\r\n		value: \'value\', // value字段\r\n	  });\r\n	   var json_${element.mid!\'\'} =  $.parseJSON( $(\"#json_${element.mid!\'\'}\").text() );\r\n	  $(\"#json_${element.mid!\'\'}\").remove();\r\n	  ChartAction.renderChart(\'${element.mid!\'\'}\',dv_${element.mid!\'\'},json_${element.mid!\'\'})\r\n	</script>\r\n', '4028811b618d0dca01618d5a5fe6034a', 'cskefu', '/images/design/radar.gif', NULL, NULL, NULL, NULL, 0, NULL, 'radar');
INSERT INTO `uk_templet` VALUES ('4028811b6191e289016191ee589c0349', 'KPI图', NULL, 'report', NULL, '2018-02-14 09:29:32', NULL, NULL, '<div id=\"element_${reportModel.id!\'\'}\" class=\"r3-data-element\" style=\"min-width:100px;min-height:65px;\">\r\n\r\n    <#if reportModel.reportData?? && reportModel.reportData.data??>\r\n    	<#list reportModel.reportData.data as values>\r\n    		<#if values_index == 0>\r\n    			<#list values as value>\r\n    				<#if value_index ==0>\r\n    				<h1 class=\"no-margins\" <#if value.value lt 0>style=\"color:red;\"</#if>>\r\n                		${value.foramatValue!\'\'}\r\n                	</h1>\r\n                	<div class=\"stat-percent font-bold text-success\">\r\n                		<#if value.row?? && value.row.name?? && value.row.name!= \'root\' >${value.row.name!\'\'}</#if>\r\n                	</div>\r\n                	<small>\r\n                		<#if value.name??>${value.name!\'\'}</#if>\r\n                	</small>\r\n    				</#if>\r\n    			</#list>\r\n    		</#if>\r\n    	</#list>\r\n    </#if> 	\r\n</div>', '4028811b618d0dca01618d5a5fe6034a', 'cskefu', '/images/design/kpi.png', NULL, NULL, NULL, NULL, 0, NULL, NULL);
