INSERT INTO `uk_templet` VALUES ('4028811b642af06f01642afaae4f04d3', '外部机器人输出参数', NULL, 'otheraioutputparam', NULL, '2018-06-23 12:50:29', NULL, NULL, '{\r\n\"msgtype\":\"${data.data_type!\'text\'}\"\r\n<#if data?? && data.candidates?? && data.candidates?size gt 0>\r\n	<#assign suggest = \"[\">\r\n	<#list data.candidates as item>\r\n		<#if suggest?length gt 1>\r\n			<#assign suggest = suggest + \",\">\r\n		</#if>\r\n		<#if item.question??>\r\n			<#assign suggest = suggest + \'{\"id\":\"\'+item.kbid+\'\",\"title\":\"\'+item.question + \'\"}\'>\r\n		</#if>\r\n	</#list>\r\n	<#assign suggest = suggest + \"]\">\r\n	,\"items\":${suggest}\r\n</#if>\r\n<#if data?? && data.data?? && data.data.answer??>\r\n	,\"message\":\"${data.data.answer!\'\'}\"\r\n<#elseif data?? && data.data?? && data.data.kbid??>\r\n	,\"id\":\"${data.data.kbid!\'\'}\"\r\n	,\"detail\":true\r\n<#else>\r\n	,\"message\":\"${data.message!\'\'}\"\r\n</#if>\r\n}', '4028811b642af06f01642af9cfaf04c7', 'cskefu', NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL);
